package com.github.hugh.util.file;

import com.github.hugh.exception.ToolboxException;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

import java.io.ByteArrayInputStream;
import java.io.InputStream;
import java.nio.charset.StandardCharsets;
import java.util.Base64;

import static org.junit.jupiter.api.Assertions.*;

/**
 * 图片工具测试类
 *
 * @author AS
 * @date 2020/9/17 15:53
 */
class ImageTest {
    private static String getPath(String fileName) {
        return ImageTest.class.getResource(fileName).getPath();
    }

    @Test
    void testIsImage() {
        String image1 = "/file/image/69956256_p1.jpg";
        String path = ImageTest.class.getResource(image1).getPath();
        assertTrue(ImageUtils.isImage(path));
        String image2 = "/file/image/20200718234953_grmzy.jpeg";
        String path2 = ImageTest.class.getResource(image2).getPath();
        assertTrue(ImageUtils.isImage(path2));
        String image3 = "/file/image/Teresa.png";
        String path3 = ImageTest.class.getResource(image3).getPath();
        assertTrue(ImageUtils.isImage(path3));
        String image4 = "/file/image/webp/share_572031b53d646c2c8a8191bdd93a95b2.png";
        String path4 = ImageTest.class.getResource(image4).getPath();
        assertFalse(ImageUtils.isImage(path4));
        String image9 = "/file/image/heif/share_a4b448c4f972858f42640e36ffc3a8e6.png";
//        final String picTyp9 = FileTypeUtils.getType(getPath(image9));
        assertFalse(ImageUtils.isImage(getPath(image9)));
    }

    private String validBase64Image;
    private static String base64Image = "data:image/png;base64,";
    private String invalidBase64Image;
    private String nonImageBase64Data;

    @BeforeEach
    public void setUp() {
        // 有效的 Base64 编码图像
//        validBase64Image = "";
        validBase64Image = "";

        // 无效的 Base64 编码图像
        invalidBase64Image = "data:image/png;base64,invalidBase64String";

        // 非图像数据
        nonImageBase64Data = "data:text/plain;base64,SGVsbG8gV29ybGQh";
    }

    @Test
    void isBase64Image_ValidImage_ReturnsTrue() {
        byte[] decode = Base64.getDecoder().decode(validBase64Image.getBytes());
        InputStream inputStream = new ByteArrayInputStream(decode);
        assertTrue(ImageUtils.isBase64Image(inputStream));
    }

    @Test
    void isBase64Image_Base64String_ReturnsTrue() {
        InputStream inputStream = new ByteArrayInputStream(base64Image.getBytes());
        assertTrue(ImageUtils.isBase64Image(inputStream));
    }

    @Test
    void isBase64Image_InvalidImage_ReturnsFalse() {
        InputStream inputStream = new ByteArrayInputStream(invalidBase64Image.getBytes());
        assertFalse(ImageUtils.isBase64Image(inputStream));
    }

    @Test
    void testIsBase64ImageWithValidBase64ImageWithPrefix() {
        assertTrue(ImageUtils.isBase64Image(base64Image));
    }

    @Test
    void isBase64Image_EmptyStream_ReturnsFalse() {
        InputStream inputStream = new ByteArrayInputStream("".getBytes());
        assertFalse(ImageUtils.isBase64Image(inputStream));
    }

    @Test
    void isBase64Image_NonImageBase64Data_ReturnsFalse() {
        InputStream inputStream = new ByteArrayInputStream(nonImageBase64Data.getBytes());
        assertFalse(ImageUtils.isBase64Image(inputStream));
    }

    @Test
    void testIsBase64ImageWithNullInputStream() {
        assertThrows(NullPointerException.class, () -> ImageUtils.isBase64Image((InputStream) null));
    }

    @Test
    void testIsBase64ImageWithNullString() {
        assertThrows(NullPointerException.class, () -> ImageUtils.isBase64Image((String) null));
    }

    @Test
    void testIsNotBase64Image() {
        assertTrue(ImageUtils.isNotBase64Image(""));
        assertTrue(ImageUtils.isNotBase64Image(invalidBase64Image));
        assertTrue(ImageUtils.isNotBase64Image(new byte[0]));
        InputStream inputStream = new ByteArrayInputStream("".getBytes());
        assertTrue(ImageUtils.isNotBase64Image(inputStream));

    }

}


